using System.Collections;
using System.Collections.Generic;
using UnityEngine;

public class EnemyNameRandomizer : MonoBehaviour
{
    private void Start()
    {
        Game_EnemyCore[] enemyList = FindObjectsOfType<Game_EnemyCore>();
        List<int> listNameID = new List<int>();

        while (listNameID.Count < enemyList.Length)
        {
            int randomID = Random.Range(0, stringNameListFull.Length);
            bool isRepeat = false;

            foreach (int x in listNameID)
            {
                if (x == randomID)
                {
                    isRepeat = true;
                    break;
                }
            }
            if(!isRepeat)
            {
                listNameID.Add(randomID);
            }
        }

        for (int i = 0; i < enemyList.Length; i++)
        {
            if (enemyList[i].targetName == "")
            {
                enemyList[i].name += " (" + stringNameListFull[listNameID[i]] + ")";
                enemyList[i].targetName = stringNameListFull[listNameID[i]];
            }

#if UNITY_EDITOR
            Debug.Log("Name Randomizer: " + enemyList[i].name);
#endif
        }

        Destroy(this);
    }

